import axios from "axios";
import { useState, useEffect, useRef, useCallback} from "react";

export default function App() {
  const [results, setResults] = useState([])
  const [isLoading, setIsLoading] = useState(false)
  const [error, setError] = useState({})
  const [hasNextPage, setHasNextPage] = useState(false)
  useEffect(() => {
    setIsLoading(true)
    setError({})

    axios
      .get('./Foodsource.json')
      .then(res => { 
        setResults(res.data)
        setHasNextPage(Boolean(res.data.length))
        setIsLoading(false)
      })
      .catch(e => {
        setIsLoading(false)
        setError({ message: e.message })
    }) },[]);


  const displayData = results.map(
    (info)=> {
      return(
        <tr>
          <td>{info.resteraunt}</td>
          <td>{info.name}</td>
          <td>{info.people}</td>
          <td>{info.timetag}</td>
        </tr>
      )
    }
  )




  return (
    <div className="App">
      <div>
      <table class="table table-striped">
        <thead>
          <tr align="left">
            <th>Resteraunts &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</th>
            <th>Food Item</th>
            <th>Number of times bought &nbsp;</th>
            <th>How recently bought</th>
          </tr>
        </thead>
        <tbody>
          {displayData}
        </tbody>
      </table>
    </div>
    </div>


  );
}
